[{"location":"math/#Mathematical-Background-on-Taylor-Fourier-Transform","page":"Mathematical Background","title":"Mathematical Background on Taylor-Fourier Transform","text":"","category":"section"},{"location":"math/#Nomenclature","page":"Mathematical Background","title":"Nomenclature","text":"","category":"section"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"Symbol Description\ns signal\na amplitude\nϕ phase [(rad)]\nφ anti-rotating phase [(rad)]\nξ dynamic phasor\nψ anti-rotating dynamic phasor","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"Set Description\nh ∈ H set of harmonic number [Int]","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"Parameter Description\nF frequency [Hz]\nω angular frequency [(rad)/s]","category":"page"},{"location":"math/#Taylor-Fourier-Transform","page":"Mathematical Background","title":"Taylor-Fourier Transform","text":"","category":"section"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"The Taylor-Fourier Transform function tft() gives the up-to-Dth derivative of  the hth-harmonic dynamic phasors ξₕ⁽ᵈ⁾(t), ∀ d ∈ {0,..,D}, h ∈ H. ","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"The zeroth derivative of the hth-harmonic dynamic phasor ξₕ⁽⁰⁾(t) is given by,","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"beginaligned\n    xi^(0)_h(t)        = fraca^(0)_h(t)2  exp(j phi^(0)_h(t)) \n                            = fraca^(0)_h(t)2  exp(j varphi^(0)_h(t))  exp(j omega_h t) \n                            = psi^(0)_h(t)  exp(j omega_h t)\n\nendaligned","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"where ψₕ⁽⁰⁾(t) denotes the anti-rotating zeroth derivative of the hth-harmonic  dynamic phasor. ","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"The corresponding amplitude aₕ⁽⁰⁾(t), phase ϕₕ⁽⁰⁾(t) and anti-rotating phase  φₕ⁽⁰⁾(t) are, respectively,","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"beginaligned\n    a^(0)_h(t)          = 2 cdot xi^(0)_h(t) \n    phi^(0)_h(t)       = angle big( xi^(0)_h(t) big) \n    varphi^(0)_h(t)    = angle big( xi^(0)_h(t)  exp(-j omega_h t) big) = angle big( psi^(0)_h(t) big)\nendaligned","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"The corresponding hth-harmonic signal sₕ⁽⁰⁾(t) and overall signal s⁽⁰⁾(t) are,  respectively,","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"beginaligned\n    s^(0)_h(t)          = xi^(0)_h(t) + textconjbig( xi^(0)_h(t) big) \n    s^(0)(t)              = sum_h in H xi^(0)_h(t) + textconjbig( xi^(0)_h(t) big)\nendaligned","category":"page"},{"location":"math/","page":"Mathematical Background","title":"Mathematical Background","text":"where conj(ξₕ⁽⁰⁾(t)) denotes the complex conjugate of the zeroth derivative of the  hth-harmonic dynamic phasor.","category":"page"},{"location":"#TFT.jl","page":"Home","title":"TFT.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"<a href=\"https://github.com/timmyfaraday/TFT.jl/actions?query=workflow%3ACI\"><img src=\"https://github.com/timmyfaraday/TFT.jl/workflows/CI/badge.svg\"></img></a> <a href=\"https://codecov.io/gh/timmyfaraday/TFT.jl\"><img src=\"https://img.shields.io/codecov/c/github/timmyfaraday/TFT.jl?logo=Codecov\"></img></a> <a href=\"https://timmyfaraday.github.io/TFT.jl/\"><img src=\"https://github.com/timmyfaraday/TFT.jl/workflows/Documentation/badge.svg\"></img></a>","category":"page"},{"location":"","page":"Home","title":"Home","text":"(Image: Active Development)","category":"page"}]
